import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import Card from '../Ui Kits/Cart/Card';

function Project(props) {
  return (
    <div>
      <Layout>
        <div className='main_div'>
          <h1>Project Category</h1>
          <div className='category'>
            <Card width='300px' height='500px'>
              <img
                className='ct__img'
                src={require(`../Assets/Images/Project Image/javascript.png`)}
                alt='avatar image'
              />

              <h1>Hello</h1>
            </Card>
            <Card width='300px' height='500px'>
              <img
                className='ct__img'
                src={require(`../Assets/Images/Project Image/javascript.png`)}
                alt='avatar image'
              />

              <h1>Hello</h1>
            </Card>
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
